import React from "react";
import "./Home.css";
import Cover from "../../img/bg-soap.png";
//import Tap from "../../img/ic-tap.png";

const Home = () => {
  return (
    <div className="Home">
      <div className="back">
        <img src={Cover} alt="" />
        <div class="center-bottom-text">Touch to start your refill process</div>
        <div class="center-top-text">Let's Reduce and Reuse plastics</div>
      </div>
    </div>
  );
};

export default Home;
